CREATE TRIGGER `trig_update_material_stocks_on_consume` AFTER INSERT ON `consume_materials_details` FOR EACH ROW BEGIN
	DECLARE vPurOrdNo bigint(18);
	DECLARE vDate date;
	SELECT r_cons_order_no,r_cons_order_date FROM consume_materials 
    where id = NEW.r_cons_order_id INTO vPurOrdNo, vDate;
	
	item_op_comp_id = NEW.r_cons_comp_id,
	item_ref_id = NEW.r_cons_item_id,
	item_warehouse_id = NEW.r_cons_warehouse_id,
	item_storage_loc = NEW.r_cons_storage_id,
	item_lot_no = NEW.r_cons_lot_no,
	item_op_dt = vDate,
	item_op_stock = -NEW.r_cons_item_qty,
        item_base_price = NEW.r_cons_item_price,
	item_trans_desc = 'CI',
	item_trans_ref = NEW.r_cons_order_id,
	item_trans_ref_no = vPurOrdNo,
	item_trans_order = 2,
	created_by=NEW.created_by,
	created_at=NEW.created_at;
    END
$$
